import Vue from "vue";
import Router from "vue-router";

const Index = () => import("@/Index");
const Home = () => import("@/Home");

Vue.use(Router);
let token = localStorage.getItem("token");

let router = new Router({
    routes:[       
        {
            path:"/",
            name:"Index",
            component: Index
        },
        {
            path: "/home",
            name: "Index",
             beforeEnter:(to,from,next)=>{
                if(token) next(true)
                else next('/')
            },
            component:Home           
        },
    ]
});

export default router;
